import React, {Component} from "react";
import Alert from "bootstrap/js/src/alert";


class Feedback extends Component {
    constructor(props) {
        super(props);
    }

    render() {
        return (
            <div className="alert alert-danger mt-2">
                <p>this.props.feedback_text</p>
            </div>
        );
    }
}

export default Feedback;
